        static byte[] String2Byte(string text)
        {
            var byte_ary = new byte[text.Length / 2];
            for (int i = 0; i < text.Length - 1; i += 2)
                byte_ary[i / 2] = (byte)Convert.ToUInt32("0x" + text.Substring(i, 2), 16);
            return byte_ary;
        }
